    "access_constraints",ntt"value": "["Use Constraints: The GIS files and
    their associated coordinates are not themselves the legal definition of the boundaries
    of a critical habitat designation. The map of the designated area contained in the
    final rule for the species, as published in the Federal Register and as clarified
    or refined by any textual language within the rule, establishes the legal critical
    habitat boundary. However, the Service relies on the information contained in the
    GIS files and their associated coordinates in developing the map contained within
    the rule. Given the technical limitations of what can be published in the Federal
    Register, there may be instances in which members of the public use these GIS files
    and their associated coordinates to ascertain the Service's interpretation of the
    maps. Therefore, once maps or coordinate information are placed here, we will not
    remove them unless there has been a duly promulgated change in the critical habitat's
    legal boundary within the rule. If, for some reason, new information is placed here,
    the old information will remain as well. The USFWS shall not be held liable for
    improper or incorrect use of the data described and/or contained herein. This data
